import React from "react";
import styled from "styled-components";

const Button = styled.button`
  color: #57d655;
  font-size: 10px;
  padding: 10px 10px;
  border-radius: 5px;
  border-color: #57d655;
  border-width: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

const Btn = () => {
  return (
    <div>
      <Button>Click Me</Button>
    </div>
  );
};

export default Btn;
